import * as React from "react";
import { Routes, Route, Link} from "react-router";
import "./App.css";
import Portfolio from "./views/portfolio";

function App() {
  return (
    <div className="App">
      <h1>Welcome to React Router!</h1>
      <Routes>
        <Route path="" element={<Portfolio />} />
      </Routes>
    </div>
  );
}
function Home() {
  return (
    <>
      <main>
        <Portfolio/>
      </main>
    </>
  );
}
export default App();
